                    "充值拒绝原因": "Motif du rejet de la recharge ",
                    "1、假如您是A，你邀请了B、C、D，B又邀请了E和F，A无投注，B、C、D、E、F各投注10万。即A的总业绩为50万，属于返佣的第6级，每万80元返佣。": "1. Si vous êtes A, vous invitez B, C, D et B invite E et F. A n'a pas de pari, et B, C, D, E et F parient chacun 100 000. C'est-à-dire que la performance totale de A est de 500 000, ce qui appartient au sixième niveau de la remise, qui est de 80 yuans pour 10 000.",
                    "2、自营佣金": "2. Commission des indépendants",
                    "B、C、D三人为A的直推下级，B、C、D总计投注30万，作为A的自营业绩，按每万80元返佣。A的自营佣金=A自营业绩*A返佣比例=30*80=2400": "B, C et D sont les subordonnés directs de A. B, C et D parient un total de 300 000 yuans. En tant que performance autonome de A, la commission sera réduite à 80 yuans pour 10 000 yuans. La commission auto-gérée d'A = la performance auto-gérée d'A * Un ratio de remise = 30*80=2400",
                    "B邀请了E和F，E和F共计投注20万，作为B的团队业绩20万，A可以从B的团队业绩获得级差佣金。A的级差佣金=（A返佣比例-B返佣比例）*B团队业绩=（80-60）*20=400": "B a invité E et F. E et F ont misé un total de 200 000. Comme la performance de l'équipe de B est de 200 000, A peut obtenir une commission différentielle sur la performance de l'équipe de B. Commission de différence de note A = (ratio de remise A-ratio de remise B) * performance de l'équipe B = (80-60) * 20 = 400",
                    "1、代理佣金包括直推佣金和级差佣金两部分。": "1. La commission d'agence comprend deux parties, la commission de commission directe et la commission différentielle.",
                    "2、直推佣金：直属下级的自营流水*总业绩达到代理级别所对应的返佣比例。": "2. Direct push commission: direct subordinates' self-operated turnover * total performance reaches the commission rebate ratio corresponding to the agent level",
                    "3、级差佣金：如您代理级别比您的直属下级高，那么您的返佣比例就高于您直属下级的返佣比例，此差额形成了每万流水业绩的级差，则级差佣金=级差（您的代理级别佣金比例-直属下级代理级别佣金比例）*直属下级的业绩。代理与直属下级之间存在级别差才能获取返点，没有级差无法获得返点。": "3. Commission de différence de niveau : si le niveau de votre agent est supérieur à celui de vos subordonnés directs, votre taux de remboursement est alors supérieur au taux de remboursement de vos subordonnés directs. Cette différence forme une différence de niveau pour 10 000 performances de chiffre d'affaires, puis la commission de différence de niveau = différence de niveau (ratio de commission au niveau de votre agence-ratio de commission au niveau de l'agent subordonné direct) * performance subordonnée directe. Les remises ne peuvent être obtenues que s'il y a une différence de niveau entre l'agent et les subordonnés directs, et aucune remise ne peut être obtenue s'il n'y a pas de différence de niveau.",
